  `duty` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `companyName` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `customerMantainUser` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `customerAuth` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
