  `teamManagerName` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `operateManagerID` int(11) DEFAULT NULL,
  `operateManagerName` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `yunYingManagerName` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `yunYingManagerID` int(11) DEFAULT NULL,
  `subCompanyManagerID` int(11) DEFAULT NULL,
  `subCompanyManagerName` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `subCompanyTeamBuildID` int(11) DEFAULT NULL,
  `subCompanyTeamBuildName` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `VPID` int(11) DEFAULT NULL,
  `VPName` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `yunYingManagerTeamBuildName` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `yunYingManagerTeamBuildID` int(11) DEFAULT NULL,
  `nickName` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
