  `nationality` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`lenderID`),
  KEY `lenderID` (`lenderID`) COMMENT '(null)',
  KEY `userName` (`userName`) COMMENT '(null)',
  KEY `companyName` (`companyName`) COMMENT '(null)',
  KEY `customerManagerID` (`customerManagerID`) COMMENT '(null)',
  KEY `customerManagerName` (`customerManagerName`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

