/*Table structure for table `rah_lenderphone` */

DROP TABLE IF EXISTS `rah_lenderphone`;

CREATE TABLE `rah_lenderphone` (
  `phoneID` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `borrowerID` int(11) DEFAULT NULL COMMENT '借款人ID',
  `lenderID` int(11) DEFAULT NULL COMMENT '理财人ID',
  `userName` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '机主姓名',
  `phone` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '手机号',
  `tel` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '座机号',
  `updateUser` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '更新人',
  `updateTime` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`phoneID`)
) ENGINE=MyISAM AUTO_INCREMENT=9034 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=DYNAMIC;

